import React from 'react';
import { ClerkProvider, SignedIn, useClerk, useNavigate } from '@clerk/clerk-react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import OnboardingPage from './components/OnboardingPage';
import BuyPage from './components/BuyPage';
import RentPage from './components/RentPage';
import VenturePage from './components/VenturePage';
import './App.css';

if (!process.env.REACT_APP_CLERK_PUBLISHABLE_KEY) {
  throw new Error("Missing Publishable Key");
}

const clerkPubKey = process.env.REACT_APP_CLERK_PUBLISHABLE_KEY;

const Header = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/buy">Buy</Link>
        </li>
        <li>
          <Link to="/rent">Rent</Link>
        </li>
        <li>
          <Link to="/venture">Venture</Link>
        </li>
      </ul>
    </nav>
  );
};

const App = () => {
  const { session } = useClerk();
  const navigate = useNavigate();

  // Programmatically navigate based on user's session
  if (session && session.user) {
    navigate('/dashboard');
  }

  return (
    <div className="app-container">
      <ClerkProvider publishableKey={clerkPubKey}>
        <SignedIn>
          <Header />
        </SignedIn>
        <Routes>
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/onboarding" element={<OnboardingPage />} />
          <Route path="/buy" element={<BuyPage />} />
          <Route path="/rent" element={<RentPage />} />
          <Route path="/venture" element={<VenturePage />} />
        </Routes>
      </ClerkProvider>
    </div>
  );
};

export default App;
